}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <circle cx="12" cy="12" r="12" fill="#005f87"/>  <polygon points="15 7 15 6 6 6 6 15 7 15 7 14 7 7 14 7 15 7" fill="#fff"/>  <polygon points="14.01 9 16.993 9 16.993 8 14.01 8 14 8 8 8 8 16.993 9 16.993 9 9 14 9 14.01 9" fill="#fff"/>  <polygon points="17.005 10 16.005 10 10 10 10 16.005 10 17.005 10 19 19 19 19 10 17.005 10" fill="#fff"/>  <circle cx="12" cy="12" r="11.5" fill="none" stroke="#464646" stroke-miterlimit="10"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
